import React from 'react';
import logo from './logo.svg';
import './App.css';
import './../components/background/Background';
import { red } from 'ansi-colors';

function App() {
  return (
    <div className="App">
      <Background 
        color={"red"}
        language={"pt"}
        title={"title"}
        sub={"subtitle"}
        button={"CLICK ME"}
      />
    </div>
  );
}

export default App;
